import axios from "axios";
import { useNavigate, useParams, Link } from "react-router-dom";

import DeleteStaff from "./DeleteStaff";

import './StaffList.css'



function Staff(props){
    console.log(props);
    const navigate = useNavigate();
    const deleteStaff = (id) =>{

        return axios.delete(`http://localhost:3002/staffs/${id}`)
                    .then(response => console.log("Delete Successful"))
                    .catch(error => console.log("Error using delete operation"));
    }
    
    
    return(
        <>
        <h4>First Name: {props.details.first_name}</h4>
        <Link to={`/staffdetails/${props.details.id}`}>View Details</Link><br/><br/><br/>
        <button className="btnList btnA" onClick={() => deleteStaff(props.details.id)}>Delete Staff</button>
        <button className="btnList btnB" type="button" onClick={()=>navigate(`/staffedit/${props.details.id}`)}>Edit User</button>
        </>
    )
}
export default Staff;
